import React, { useState } from 'react';
import api from '../api/api'; 
import { useNavigate, Link } from 'react-router-dom';

function Login({ onLoginSuccess }) {
    const navigate = useNavigate();
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [error, setError] = useState('');

    const handleSubmit = async (e) => {
        e.preventDefault();
        setError('');

        try {
            const response = await api.post('/auth/login', { email, password });
            const { accessToken, user } = response.data;

            if (!accessToken) {
                setError('No se recibió token válido');
                return;
            }

            localStorage.setItem('token', accessToken);
            if (onLoginSuccess) onLoginSuccess(accessToken);

            if (user && user.rol === 'Admin') {
                navigate('/admin');
            } else {
                navigate('/bienvenida');
            }

        } catch (err) {
            console.error(err);
            setError('Email o contraseña incorrectos');
        }
    };

    // --- ESTILOS DE TEMA DE CAFÉ ---

    // Animación de fondo de puntos sutil (CSS)
    const dotAnimationCss = `
        @keyframes moveDots {
            0% { background-position: 0 0; }
            100% { background-position: 400px 400px; }
        }
        .animated-background-dots::before {
            content: '';
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background-image: radial-gradient(#ffffff20 1px, transparent 1px);
            background-size: 40px 40px;
            animation: moveDots 60s linear infinite;
            z-index: 0;
        }
    `;

    const PAGE_CONTAINER = { 
        minHeight: '100vh', 
        background: '#1e293b', // Un tono de café muy oscuro
        display: 'flex', 
        flexDirection: 'column', 
        alignItems: 'center', 
        justifyContent: 'center',
        position: 'relative',
        overflow: 'hidden'
    };
    
    const navBarButtonStyle = { 
        background: '#302119ff', // Un marrón más claro
        color: '#f0e3d2', // Tono crema para el texto
        padding: '10px 25px', 
        borderRadius: 25, // Botones más redondeados
        border: '1px solid #1f1914ff', // Borde sutil
        fontWeight: 'bold',
        cursor: 'pointer',
        textDecoration: 'none',
        transition: 'all 0.3s ease',
        boxShadow: '0 2px 5px rgba(0,0,0,0.3)',
        ':hover': {
            background: '#7a5e4b', // Más oscuro al pasar el mouse
            transform: 'translateY(-1px)'
        }
    };
    
    const formCardStyle = { 
        width: 480, // Un poco más grande para darle presencia
        background: 'rgba(44, 30, 23, 0.9)', // Fondo de tarjeta semitransparente, oscuro café
        backdropFilter: 'blur(5px)', // Desenfoque sutil
        borderRadius: 20, 
        border: '2px solid #5a3d2e', // Borde que combina
        padding: 45, 
        boxShadow: '0 15px 40px rgba(0,0,0,0.7)', // Sombra profunda
        display: 'flex', 
        flexDirection: 'column', 
        alignItems: 'center',
        zIndex: 10, // Asegura que esté por encima del fondo y animación
        color: '#f0e3d2' // Texto por defecto crema
    };
    
    const welcomeBannerStyle = { 
        background: '#8c5e42', // Marrón medio cálido
        color: '#f0e3d2', 
        borderRadius: 15, 
        marginBottom: 35, 
        padding: '15px 0', 
        width: '100%', 
        textAlign: 'center', 
        fontWeight: 'bold',
        fontSize: 26, // Título más grande
        letterSpacing: '0.5px',
        textShadow: '1px 1px 2px rgba(0,0,0,0.2)'
    };
    
    const inputStyle = { 
        width: '100%', 
        padding: 14, 
        marginBottom: 25, 
        borderRadius: 10, 
        background: '#3e2c24', // Input más oscuro que el fondo de la tarjeta
        fontSize: 18, 
        border: '1px solid #5a3d2e',
        color: '#f0e3d2',
        transition: 'border-color 0.3s ease, box-shadow 0.3s ease',
        boxShadow: 'inset 0 1px 3px rgba(0,0,0,0.3)',
        ':focus': {
            borderColor: '#be876b', // Borde más claro al enfocar
            boxShadow: '0 0 0 3px rgba(190, 135, 107, 0.3)'
        }
    };
    
    const submitButtonStyle = { 
        width: '100%', 
        background: '#8c5e42', // Verde esmeralda o color de acento
        color: '#f0e3d2', 
        padding: 18, 
        borderRadius: 10, 
        fontWeight: 'bold', 
        fontSize: 20, 
        border: 'none', 
        marginBottom: 15,
        cursor: 'pointer',
        transition: 'background 0.3s ease, transform 0.2s ease',
        boxShadow: '0 5px 15px rgba(0,0,0,0.4)',
        ':hover': {
            background: '#be876b', // Tono más cálido al pasar el mouse
            transform: 'translateY(-2px)'
        }
    };
    
    const secondaryButtonStyle = { 
        width: '100%', 
        background: 'transparent', 
        color: '#f0e3d2', 
        padding: 12, 
        borderRadius: 10, 
        fontSize: 16, 
        border: '1px solid #5a3d2e',
        cursor: 'pointer',
        transition: 'background 0.3s ease, border-color 0.3s ease',
        ':hover': {
            background: '#3e2c24', // Fondo sutil al pasar el mouse
            borderColor: '#8c5e42'
        }
    };

    const labelStyle = { 
        marginBottom: 8, 
        display: 'block', 
        fontWeight: 'bold', 
        color: '#e0c9b7', // Tono de texto más claro
        fontSize: 18 
    };

    return (
        <div style={PAGE_CONTAINER} className="animated-background-dots">
            {/* Insertar la animación CSS directamente */}
            <style>{dotAnimationCss}</style>

            {/* Barra superior */}
            <div style={{ width: 550, display: 'flex', justifyContent: 'space-around', marginBottom: 70, zIndex: 10 }}>
                <Link to="/contacto" style={navBarButtonStyle}>Contactanos</Link>
                <button style={{...navBarButtonStyle, background: '#be876b', color: '#2c1e17'}}>Login</button> {/* Botón de login resaltado */}
                <Link to="/" style={navBarButtonStyle}>Inicio</Link>
            </div>
            
            {/* Card central */}
            <div style={formCardStyle}>
                <div style={welcomeBannerStyle}>
                    <span role="img" aria-label="coffee cup">☕</span> ¡Bienvenido a tu Café!
                </div>
                <form style={{ width: '100%' }} onSubmit={handleSubmit}>
                    <label style={labelStyle}>Email</label>
                    <input type="email" value={email} onChange={e => setEmail(e.target.value)} style={inputStyle} required />
                    
                    <label style={labelStyle}>Contraseña</label>
                    <input type="password" value={password} onChange={e => setPassword(e.target.value)} style={inputStyle} required />
                    
                    <button type="submit" style={submitButtonStyle}>Ingresar</button>
                    
                    {error && <div style={{ color: '#ff7766', textAlign: 'center', marginBottom: 15, fontSize: 16 }}>{error}</div>}
                </form>
                <button style={secondaryButtonStyle}>Olvidé mi contraseña</button>
            </div>
        </div>
    );
}

export default Login;
